import { Link } from "react-router-dom"
const DUMMY_EVENTS = [
    {id: 'p1', title: 'event 1'},
    {id: 'p2', title: 'event 2'},
    {id: 'p3', title: 'event 3'}
]

const EventsPage = () => {
    return (
        <>
        <h1>Events Page</h1>
        <ul>
            {DUMMY_EVENTS.map((event) => <li></li>)}
        </ul>
        </>
    )
}

export default EventsPage
